      "id": 6563956490372,
      "handle": "mens-tree-pipers-white-sands",
      "masterId": "MENS_TREE_PIPERS",
      "description": "<p>The Tree Piper is a classic low-top silhouette that's been reimagined for everyday casual wear while walking in warmer weather. It's made with lightweight, breathable, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
      "localizedDescription": {
        "de-DE": "<p>Der Tree Piper ist ein klassischer, niedriger Sneaker, der sich am besten als Freizeitschuh bei wärmerem Wetter eignet. Er besteht aus luftig-leichten und bequemen natürlichen Materialien und passt dank seines simplen und doch trendigen Designs perfekt zu jedem Outfit.</p>",
        "en-US": "<p>The Tree Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in warmer weather. It&#39;s made with lightweight, breathable, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "fr-FR": "<p>La Tree Piper est une chaussure basse intemporelle qui a été réimaginée pour être portée quand la température grimpe. Elle est conçue à partir de matériaux naturels légers, aérés et confortables, et peut être portée avec des looks différents.</p>",
        "it-IT": "<p>Le Tree Piper sono un modello basso dalla linea classica reinventato per essere indossato ogni giorno e passeggiare quando fa caldo. Sono realizzate in materiali naturali leggeri, traspiranti e comodi. L’equilibrio perfetto tra semplicità e audacia, per uno stile versatile.</p>",
        "ja-JP": "<p>Tree Piperは、クラシックなデザインを洗練させたローカットスニーカー。軽量で通気性に優れた天然素材を使用し、特徴的なディティールとシンプルさをバランスよく取り入れました。どんなコーディネートとも相性がよく、普段使いにぴったりです。</p>",
        "ko-KR": "<p>Tree Piper는 클래식 로우탑 디자인을 재해석한 따뜻한 날씨에 적합한 데일리 캐주얼 웨어입니다. 부드럽고 포근한 천연 소재로 만든 어디에나 어울리는 조화로운 디자인을 자랑하는 신발입니다. </p>",
        "nl-NL": "<p>De Tree Piper is een klassiek low-top silhouet dat is heruitgevonden voor warmere dagen. De comfortabele schoen is gemaakt van zachte, natuurlijke materialen en kun je zowel eenvoudig en veelzijdig stylen.</p>",
        "zh-CN": "<p>舒适全天候，百搭随心配。 经典款低帮板鞋，南非桉树纤维材料编织成呼吸感鞋面，清爽透气，轻松出街。专为夏日穿着打造。</p>",
        "en-GB": "<p>The Tree Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in warmer weather. It&#39;s made with lightweight, breathable, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-AU": "<p>The Tree Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in warmer weather. It&#39;s made with lightweight, breathable, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-NZ": "<p>The Tree Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in warmer weather. It&#39;s made with lightweight, breathable, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-CA": "<p>The Tree Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in warmer weather. It&#39;s made with lightweight, breathable, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-EU": "<p>The Tree Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in warmer weather. It&#39;s made with lightweight, breathable, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>"
      },
