      "handle": "mens-tree-toppers-marine",
      "masterId": "MENS_TREE_TOPPERS",
      "description": "<p>The Tree Topper is a minimalist high-top shoe made with lightweight, breathable eucalyptus fibre. Perfect for warmer weather walking and everyday casual wear.</p>",
      "localizedDescription": {
        "de-DE": "<p>Der Tree Topper ist ein minimalistischer, hoher Sneaker aus luftig-leichten Eukalyptusfasern. Er eignet sich am besten als Freizeitschuh bei wärmerem Wetter.</p>",
        "en-AU": "<p>The Tree Topper is a minimalist high-top shoe made with lightweight, breathable eucalyptus fibre. Perfect for warmer weather walking and everyday casual wear.</p>",
        "en-CA": "<p>The Tree Topper is a minimalist high-top shoe made with lightweight, breathable eucalyptus fibre. Perfect for warmer weather walking and everyday casual wear.</p>",
        "en-EU": "<p>The Tree Topper is a minimalist high-top shoe made with lightweight, breathable eucalyptus fibre. Perfect for warmer weather walking and everyday casual wear.</p>",
        "en-GB": "<p>The Tree Topper is a minimalist high-top shoe made with lightweight, breathable eucalyptus fibre. Perfect for warmer weather walking and everyday casual wear.</p>",
        "en-NZ": "<p>The Tree Topper is a minimalist high-top shoe made with lightweight, breathable eucalyptus fibre. Perfect for warmer weather walking and everyday casual wear.</p>",
        "en-US": "<p>The Tree Topper is a minimalist high-top shoe made with lightweight, breathable eucalyptus fiber. Perfect for warmer weather walking and everyday casual wear.</p>",
        "fr-FR": "<p>La Tree Topper est une chaussure montante minimaliste conçue en fibre d&#39;eucalyptus légère et aérée. Parfaite pour les promenades par temps chaud et les tenues décontractées au quotidien.</p>",
        "it-IT": "<p>Le Tree Topper sono la nostra versione minimal delle sneakers alte, realizzate in fibra di eucalipto leggera e traspirante. Perfette per passeggiare anche quando fa caldo e da indossare ogni giorno.</p>",
        "ja-JP": "<p>Tree Topper は、軽量で通気性の良いユーカリ繊維を使用したハイカットです。シルクのように滑らかな肌触りで、暖かい日の散歩やお出かけに最適です。</p>",
        "ko-KR": "<p>Tree Topper는 미니멀리스트 하이탑으로 가볍고 통기성이 뛰어난 유칼립투스 나무 섬유로 만들었습니다. 따뜻한 날씨에 적합하며 캐주얼 웨어에 완벽한 데일리 워킹화입니다.</p>",
        "nl-NL": "<p>De Tree Topper is een minimalistische high-top schoen gemaakt van lichte, ademende eucalyptusvezel. Perfect voor wandelingen bij warmer weer en om elke dag te dragen.</p>",
        "zh-CN": "<p>我们的高帮桉树球鞋丝滑透气，极简不简单的设计，为你的日常增添恰好的时髦感。</p>"
      },
