      "handle": "mens-wool-pipers-diablo",
      "masterId": "MENS_WOOL_PIPERS",
      "description": "<p>The Wool Piper is a classic low-top silhouette that's been reimagined for everyday casual wear while walking in cooler weather. It's made with soft, cosy, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
      "localizedDescription": {
        "de-DE": "<p>Der Wool Piper ist ein klassischer, niedriger Sneaker, der sich am besten als Freizeitschuh bei kühlerem Wetter eignet. Er besteht aus weichen und bequemen natürlichen Materialien und passt dank seines simplen und doch trendigen Designs perfekt zu jedem Outfit.</p>",
        "en-AU": "<p>The Wool Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in cooler weather. It&#39;s made with soft, cosy, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-CA": "<p>The Wool Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in cooler weather. It&#39;s made with soft, cosy, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-EU": "<p>The Wool Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in cooler weather. It&#39;s made with soft, cosy, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-GB": "<p>The Wool Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in cooler weather. It&#39;s made with soft, cosy, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-NZ": "<p>The Wool Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in cooler weather. It&#39;s made with soft, cosy, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "en-US": "<p>The Wool Piper is a classic low-top silhouette that&#39;s been reimagined for everyday casual wear while walking in cooler weather. It&#39;s made with soft, cozy, and comfortable natural materials, and is all about balancing simplicity and exaggeration for versatile styling.</p>",
        "fr-FR": "<p>La Wool Piper est une chaussure basse au look intemporel qui a été réimaginée pour un quotidien décontracté lors de vos promenades par temps frais. Elle est conçue en matériaux naturels doux, cosy et peut être portée avec différents looks.</p>",
        "it-IT": "<p>Le Wool Piper sono un modello basso dalla linea classica reinventato per essere indossato ogni giorno e passeggiare quando fa freddo. Sono realizzate in materiali naturali morbidi, caldi e comodi. L’equilibrio perfetto tra semplicità e audacia, per uno stile versatile.</p>",
        "ja-JP": "<p>Wool Piperは、クラシックなデザインを洗練させたローカットスニーカー。柔らかくて肌触りの良い天然素材を使用し、特徴的なディティールとシンプルさをバランスよく取り入れました。どんなコーディネートとも相性がよく、普段使いにぴったりです。</p>",
        "ko-KR": "<p>Wool Piper는 클래식 로우탑 디자인을 재해석한 쌀쌀한 날씨에 적합한 데일리 캐주얼웨어입니다. 부드럽고 포근한 천연 소재로 만든 어디에나 어울리는 조화로운 디자인을 자랑하는 신발입니다. </p>",
        "nl-NL": "<p>De Wool Piper is een klassiek low-top silhouet ideaal voor frissere dagen. De comfortabele schoen is gemaakt van zachte, natuurlijke materialen en kun je zowel eenvoudig en veelzijdig stylen.</p>",
        "zh-CN": "<p>用天然材料重塑经典鞋型，平衡简单风格和多样穿搭场景，妥帖你的百变日常。</p>"
      },
