      "id": 6616183046276,
      "handle": "mens-wool-runner-mizzles-ausangate",
      "masterId": "MENS_WOOL_RUNNER_MIZZLES",
      "description": "<p>The Wool Runner Mizzle is our rain-ready sneaker that keeps your feet warm, cosy, and dry in unpredictable weather. Cosy ZQ Merino Wool is combined with our bio-based water repellent shield so you can walk comfortably in the rain. These shoes are great everyday shoes, with all condition traction to grip slippery surfaces. </p>",
      "localizedDescription": {
        "de-DE": "<p>Der Wool Runner Mizzle ist unser regenfester Sneaker, der deine Füße bei jedem Wetter warm und trocken hält. Er besteht aus weicher ZQ-Merinowolle, die mit einer biobasierten, wasserabweisenden Schutzschicht behandelt wurde, dank der du auch im Regen stets beschwingten Schrittes unterwegs bist. Diese Schuhe sind ideale Freizeitschuhe, deren Sohlen sicheren Halt auf rutschigem Untergrund bieten. </p>",
        "en-AU": "<p>The Wool Runner Mizzle is our rain-ready sneaker that keeps your feet warm, cosy, and dry in unpredictable weather. Cosy ZQ Merino Wool is combined with our bio-based water repellent shield so you can walk comfortably in the rain. These shoes are great everyday shoes, with all condition traction to grip slippery surfaces. </p>",
        "en-CA": "<p>The Wool Runner Mizzle is our rain-ready sneaker that keeps your feet warm, cosy, and dry in unpredictable weather. Cosy ZQ Merino Wool is combined with our bio-based water repellent shield so you can walk comfortably in the rain. These shoes are great everyday shoes, with all condition traction to grip slippery surfaces. </p>",
        "en-EU": "<p>The Wool Runner Mizzle is our rain-ready sneaker that keeps your feet warm, cosy, and dry in unpredictable weather. Cosy ZQ Merino Wool is combined with our bio-based water repellent shield so you can walk comfortably in the rain. These shoes are great everyday shoes, with all condition traction to grip slippery surfaces. </p>",
        "en-GB": "<p>The Wool Runner Mizzle is our rain-ready sneaker that keeps your feet warm, cosy, and dry in unpredictable weather. Cosy ZQ Merino Wool is combined with our bio-based water repellent shield so you can walk comfortably in the rain. These shoes are great everyday shoes, with all condition traction to grip slippery surfaces. </p>",
        "en-NZ": "<p>The Wool Runner Mizzle is our rain-ready sneaker that keeps your feet warm, cosy, and dry in unpredictable weather. Cosy ZQ Merino Wool is combined with our bio-based water repellent shield so you can walk comfortably in the rain. These shoes are great everyday shoes, with all condition traction to grip slippery surfaces. </p>",
        "en-US": "<p>The Wool Runner Mizzle is our rain-ready sneaker that keeps your feet warm, cozy, and dry in unpredictable weather. Cozy ZQ Merino Wool is combined with our bio-based water repellent shield so you can walk comfortably in the rain. These shoes are great everyday shoes, with all condition traction to grip slippery surfaces. </p>",
        "fr-FR": "<p>La Wool Runner Mizzle est notre basket pour la pluie qui garde vos pieds au chaud et sec par tous les temps. La laine mérinos ZQ confortable est combinée à notre bouclier déperlant biologique pour que vous puissiez marcher confortablement sous la pluie. Ces chaussures sont idéales pour tous les jours, avec une traction en toutes circonstances pour adhérer sur les surfaces glissantes. </p>",
        "it-IT": "<p>Le Wool Runner Mizzle sono le nostre sneakers impermeabili, perfette per tenere i piedi al caldo, comodi e asciutti quando il tempo è imprevedibile. La lana merino ZQ morbida e calda è rivestita con la nostra membrana idrorepellente di origine naturale, per passeggiare senza problemi sotto la pioggia. Sono scarpe ideali da indossare ogni giorno e che aderiscono su tutte le superfici, anche le più scivolose.</p>",
        "ja-JP": "<p>ウールランナーミズルは天然素材のレインスニーカー。雨の日でも足を暖かく、ドライに保ちます。天然由来の撥水シールドを施したZQメリノウールのアッパーや、滑りやすい路面にも対応する天然ゴムの靴底が、あなたの雨の日を快適にします。</p>",
        "ko-KR": "<p>Wool Runner Mizzle은 변덕스러운 날씨에도 발을 따뜻하고 보송하게 유지해 주는 웨더 스니커즈입니다. 젖은 날씨에도 포근한 ZQ 메리노 울과 바이오 기반의 발수 쉴드가 당신의 발을 보호합니다. 미끄러운 노면에서 훌륭한 접지력을 자랑하는 데일리 신발입니다.</p>",
        "nl-NL": "<p>De Wool Runner Mizzle is onze regenbestendige sneaker die je voeten warm, knus en droog houdt tijdens onvoorspelbaar weer. De knusse ZQ Merinowol wordt gecombineerd met onze bio-based waterafstotende beschermlaag zodat je comfortabel in de regen kunt lopen. Deze schoenen zijn ideaal voor elke dag. Grip in alle omstandigheden, ook op gladde oppervlakken.</p>",
        "zh-CN": "<p>此款全新Wool Runner晴雨鞋延续经典休闲鞋简约设计，以柔软舒适的美利奴羊毛为面料，利用天然橡胶鞋底加深底部纹路，结合Puddle Guard™防泼水涂层面料，让阴雨季节也内心晴朗。</p>"
      },
