      "id": 3955809419382,
      "handle": "mens-wool-runner-up-mizzles",
      "masterId": "MENS_WOOL_RUNNER_UP_MIZZLES",
      "description": "<p>The Wool Runner-up Mizzle is a wet-weather high top made with ZQ Merino wool and a bio-based water repellent shield, so your feet stay dry and cozy no matter what the weather is.</p>",
      "localizedDescription": {
        "de-DE": "<p>Der Wool Runner-up Mizzle ist ein wetterfester hoher Sneaker, der aus Merinowolle besteht und über eine biobasierte, wasserabweisende Schutzschicht verfügt, die deine Füße bei jedem Wetter warm und trocken hält.</p>",
        "en-US": "<p>The Wool Runner-up Mizzle is a wet-weather high top made with ZQ Merino wool and a bio-based water repellent shield, so your feet stay dry and cozy no matter what the weather is.</p>",
        "fr-FR": "<p>La Wool Runner-up Mizzle est l&#39;indispensable pour temps pluvieux, conçue en laine mérinos ZQ et doté d&#39;un bouclier déperlant d&#39;origine biologique, afin que vos pieds restent secs et confortables, quelle que soit la météo.</p>",
        "it-IT": "<p>Le Wool Runner-up Mizzle sono le nostre sneakers alte impermeabili realizzate in lana merino ZQ rivestita da una membrana idrorepellente di origine naturale. I piedi resteranno asciutti e al caldo in qualsiasi condizione.</p>",
        "ja-JP": "<p>Wool Runner-up Mizzleは、ZQメリノウールのアッパーに天然由来の撥水シールドを施した雨の日用ハイカットスニーカー。ちょっとした雨の日でも足を暖かく、ドライに快適に保ちます。</p>",
        "ko-KR": "<p>Wool Runner-up Mizzle은 ZQ 메리노 울과 바이오 기반의 발수 쉴드로 만든 우천에 완벽한 하이탑 스니커즈입니다. 어떤 날씨에도 보송하고 따뜻한 발을 유지하세요.</p>",
        "nl-NL": "<p>De Wool Runner-up Mizzle is ideaal bij regenachtig weer, gemaakt van ZQ Merinowol met een bio-based waterafstotende beschermlaag zodat je voeten droog en warm blijven tijdens alle weersomstandigheden.</p>",
        "zh-CN": "<p>此款全新高帮晴雨鞋以柔软舒适的美利奴羊毛为面料，利用天然橡胶鞋底加深底部纹路，结合Puddle Guard™防泼水涂层面料，带你发现雨天的美好。</p>",
        "en-GB": "<p>The Wool Runner-up Mizzle is a wet-weather high top made with ZQ Merino wool and a bio-based water repellent shield, so your feet stay dry and cozy no matter what the weather is.</p>",
        "en-AU": "<p>The Wool Runner-up Mizzle is a wet-weather high top made with ZQ Merino wool and a bio-based water repellent shield, so your feet stay dry and cozy no matter what the weather is.</p>",
        "en-NZ": "<p>The Wool Runner-up Mizzle is a wet-weather high top made with ZQ Merino wool and a bio-based water repellent shield, so your feet stay dry and cozy no matter what the weather is.</p>",
        "en-CA": "<p>The Wool Runner-up Mizzle is a wet-weather high top made with ZQ Merino wool and a bio-based water repellent shield, so your feet stay dry and cozy no matter what the weather is.</p>",
        "en-EU": "<p>The Wool Runner-up Mizzle is a wet-weather high top made with ZQ Merino wool and a bio-based water repellent shield, so your feet stay dry and cozy no matter what the weather is.</p>"
      },
