        "ko-KR": "<p>올버즈 Tree Runner는 통기성이 뛰어나고 가벼운 스니커즈로 유칼립투스 나무 섬유를 사용해 피부에 부드럽고 시원합니다. 따뜻한 계절에 완벽한 데일리 워킹화로 캐주얼 웨어와 어울립니다.</p>",
        "nl-NL": "<p>De Allbirds Tree Runner is een ademende en lichte sneaker gemaakt van verantwoord gewonnen eucalyptusboomvezels die zijdezacht en fris aanvoelt op je huid. Deze schoenen zijn perfect voor elke dag, om te wandelen, en bij warmer weer.</p>",
        "zh-CN": "<p>体贴入微的时尚休闲鞋，轻盈及透气舒适感，是阳光下跋涉的理想选择。</p>"
