      "id": 5143217569924,
      "handle": "womens-tree-runners",
      "masterId": "WOMENS_TREE_RUNNERS",
      "description": "<p>The Allbirds Tree Runner is a breathable and lightweight sneaker made with responsibly sourced eucalyptus tree fibre that feels silky smooth and cool on your skin. These shoes are perfect for everyday casual wear, walking, and warmer weather.</p>",
      "localizedDescription": {
        "de-DE": "<p>Der Allbirds Tree Runner ist ein luftig-leichter Sneaker aus verantwortungsvoll beschafften Eukalyptusfasern, die sich seidig-weich anfühlen und zudem einen kühlenden Effekt auf der Haut haben. Am besten eignet sich dieser Sneaker als Freizeitschuh bei wärmerem Wetter.</p>",
        "en-AU": "<p>The Allbirds Tree Runner is a breathable and lightweight sneaker made with responsibly sourced eucalyptus tree fibre that feels silky smooth and cool on your skin. These shoes are perfect for everyday casual wear, walking, and warmer weather.</p>",
        "en-CA": "<p>The Allbirds Tree Runner is a breathable and lightweight sneaker made with responsibly sourced eucalyptus tree fibre that feels silky smooth and cool on your skin. These shoes are perfect for everyday casual wear, walking, and warmer weather.</p>",
        "en-EU": "<p>The Allbirds Tree Runner is a breathable and lightweight sneaker made with responsibly sourced eucalyptus tree fibre that feels silky smooth and cool on your skin. These shoes are perfect for everyday casual wear, walking, and warmer weather.</p>",
        "en-GB": "<p>The Allbirds Tree Runner is a breathable and lightweight sneaker made with responsibly sourced eucalyptus tree fibre that feels silky smooth and cool on your skin. These shoes are perfect for everyday casual wear, walking, and warmer weather.</p>",
        "en-NZ": "<p>The Allbirds Tree Runner is a breathable and lightweight sneaker made with responsibly sourced eucalyptus tree fibre that feels silky smooth and cool on your skin. These shoes are perfect for everyday casual wear, walking, and warmer weather.</p>",
        "en-US": "<p>The Allbirds Tree Runner is a breathable and lightweight sneaker made with responsibly sourced eucalyptus tree fiber that feels silky smooth and cool on your skin. These shoes are perfect for everyday casual wear, walking, and warmer weather.</p>",
        "fr-FR": "<p>La Tree Runner d&#39;Allbird est une basket légère et aérée, conçue à partir de fibres d&#39;eucalyptus de source responsable, qui sont douces et soyeuses au toucher et qui ont un effet rafraîchissant sur la peau. Ces chaussures sont parfaites pour les tenues décontractées au quotidien, la marche et le temps plus chaud.</p>",
        "it-IT": "<p>Le Allbirds Tree Runner sono le nostre sneakers traspiranti e leggere realizzate in fibra di eucalipto di origine etica. Sono lisce come seta e fresche sulla pelle. Perfette per essere indossate ogni giorno, per passeggiare e per le temperature più calde.</p>",
        "ja-JP": "<p>Tree Runnerは、責任を持って調達されたユーカリの木の繊維を使用した、通気性の良い軽量スニーカーです。シルクのように滑らかで涼しい肌触りで、暖かい日のウォーキング、お出かけに最適です。</p>",
        "ko-KR": "<p>올버즈 Tree Runner는 통기성이 뛰어나고 가벼운 스니커즈로 유칼립투스 나무 섬유를 사용해 피부에 부드럽고 시원합니다. 따뜻한 계절에 완벽한 데일리 워킹화로 캐주얼 웨어와 어울립니다.</p>",
        "nl-NL": "<p>De Allbirds Tree Runner is een ademende en lichte sneaker gemaakt van verantwoord gewonnen eucalyptusboomvezels die zijdezacht en fris aanvoelt op je huid. Deze schoenen zijn perfect voor elke dag, om te wandelen, en bij warmer weer.</p>",
        "zh-CN": "<p>体贴入微的时尚休闲鞋，轻盈及透气舒适感，是阳光下跋涉的理想选择。</p>"
      },
