      "description": "<p>The Tree Skipper is a better version of the boat shoe, made with lightweight and breathable eucalyptus fibre. Designed for everyday casual wear and perfect for warmer weather.</p>",
      "localizedDescription": {
        "de-DE": "<p>Sein Material aus luftig-leichten Eukalyptusfasern macht den Tree Skipper zum überlegenen Segelschuh. Er wurde als Freizeitsneaker entworfen und eignet sich am besten für wärmeres Wetter.</p>",
        "en-AU": "<p>The Tree Skipper is a better version of the boat shoe, made with lightweight and breathable eucalyptus fibre. Designed for everyday casual wear and perfect for warmer weather.</p>",
        "en-CA": "<p>The Tree Skipper is a better version of the boat shoe, made with lightweight and breathable eucalyptus fibre. Designed for everyday casual wear and perfect for warmer weather.</p>",
        "en-EU": "<p>The Tree Skipper is a better version of the boat shoe, made with lightweight and breathable eucalyptus fibre. Designed for everyday casual wear and perfect for warmer weather.</p>",
        "en-GB": "<p>The Tree Skipper is a better version of the boat shoe, made with lightweight and breathable eucalyptus fibre. Designed for everyday casual wear and perfect for warmer weather.</p>",
        "en-NZ": "<p>The Tree Skipper is a better version of the boat shoe, made with lightweight and breathable eucalyptus fibre. Designed for everyday casual wear and perfect for warmer weather.</p>",
        "en-US": "<p>The Tree Skipper is a better version of the boat shoe, made with lightweight and breathable eucalyptus fiber. Designed for everyday casual wear and perfect for warmer weather.</p>",
        "fr-FR": "<p>La Tree Skipper est une version améliorée de la chaussure bateau, en fibre d&#39;eucalyptus légère et aérée. Conçue pour être portée tous les jours de façon décontractée, elle est parfaite pour les températures qui grimpent.</p>",
        "it-IT": "<p>Le Tree Skipper sono una versione migliorata delle scarpe da barca, realizzate in fibra di eucalipto leggera e traspirante. Pensate per essere indossate ogni giorno e perfette per le temperature più calde.</p>",
        "ja-JP": "<p>Tree Skipperは、軽量で通気性の良いユーカリ繊維を使用したデッキシューズです。シルクのように滑らかな肌触りで、暖かい日のデイリー散歩やお出かけに最適です。</p>",
        "ko-KR": "<p>Tree Skipper는 가볍고 통기성이 뛰어난 유칼립투스 나무 섬유로 만든 보트 슈즈입니다. 따뜻한 날씨에 최적이며 데일리 캐주얼 웨어를 위한 디자인입니다.</p>",
        "nl-NL": "<p>De Tree Skipper is een betere versie van de bekende bootschoen, gemaakt van lichte en ademende eucalyptusvezel. Ontworpen om elke dag te dragen en perfect voor warmer weer.</p>",
        "zh-CN": "<p>我们的桉树船鞋丝滑透气，对环境负责的取材方式，让你轻松穿行各种生活场景。</p>"
      },
