      "id": 5147675590788,
      "handle": "womens-wool-runner-fluffs-natural-white",
      "masterId": "WOMENS_WOOL_RUNNER_FLUFFS",
      "description": "<p>The Allbirds Wool Runner Fluff is a twist on our best-selling wool sneaker. It's outrageously soft and cozy, flexible, supportive, and machine washable. The Wool Runner Fluff is comfortable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
      "localizedDescription": {
        "de-DE": "<p>Der Allbirds Wool Runner Fluff ist die flauschige Ausgabe unseres beliebten Wollsneakers. Er bietet genügend Halt, ist unfassbar weich, gemütlich und vielseitig und praktischerweise auch noch waschmaschinenfest. Der Wool Runner Fluff ist leicht und bequem und kann auch ohne Socken getragen werden. Am besten eignet er sich als Freizeitschuh bei kühlerem Wetter.</p>",
        "en-GB": "<p>The Allbirds Wool Runner Fluff is a twist on our best-selling wool sneaker. It&#39;s outrageously soft and cozy, flexible, supportive, and machine washable. The Wool Runner Fluff is comfortable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-US": "<p>The Allbirds Wool Runner Fluff is a twist on our best-selling wool sneaker. It&#39;s outrageously soft and cozy, flexible, supportive, and machine washable. The Wool Runner Fluff is comfortable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "fr-FR": "<p>La Wool Runner Fluff d&#39;Allbirds est une variante de notre chaussure en laine la plus vendue. Elle est incroyablement douce et cosy, flexible, souple et lavable en machine. La Wool Runner Fluff est confortable, légère et peut être portée sans chaussettes. Elle est idéale pour la marche, le temps plus frais et les tenues décontractées au quotidien.</p>",
        "it-IT": "<p>Le Allbirds Wool Runner Fluff sono una rivisitazione delle nostre sneakers in lana più vendute. Sono incredibilmente morbide e calde, flessibili, di supporto e lavabili in lavatrice. Le Wool Runner Fluff sono comode, leggere e possono essere indossate senza calze. Sono ideali per camminare, nelle giornate di freddo e per un look casual giornaliero.</p>",
        "ja-JP": "<p>定番のウールスニーカーにアレンジを加えた、Wool Runner Fluff。うっとりする肌触り、柔軟性、サポート力、洗濯機で洗えることが特徴です。軽くて履き心地が良く、靴下なしでもとっても快適。涼しい日のウォーキングやお出かけに最適です。</p>",
        "ko-KR": "<p>올버즈 Wool Runner Fluff는 베스트셀러 울 스니커즈의 색다른 모습을 보여줍니다. 신축성과 지지력이 뛰어나며 놀랍도록 부드러운 기계 세탁 사용이 가능한 신발입니다. 또한 통기성이 뛰어나고 가벼우며 양말 없이도 신을 수 있습니다. 워킹화로 최적이며 쌀쌀한 날씨나 데일리 캐주얼웨어에 완벽합니다. </p>",
        "nl-NL": "<p>De Allbirds Wool Runner Fluff is een twist op onze best verkochte wollen sneaker. De Wool Runner Fluff is buitengewoon zacht en knus, flexibel, ondersteunend en machinewasbaar. De Wool Runner Fluff is ademend, licht en kan zonder sokken worden gedragen. Ideaal om te wandelen, bij frisser weer, en past bij elke casual look.</p>",
        "zh-CN": "<p>天然美利奴羊打造限定款 Wool Runner Fluff，外部茸软如乖顺小羊，内部亲肤不刺痒。</p>",
        "en-AU": "<p>The Allbirds Wool Runner Fluff is a twist on our best-selling wool sneaker. It&#39;s outrageously soft and cozy, flexible, supportive, and machine washable. The Wool Runner Fluff is comfortable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-NZ": "<p>The Allbirds Wool Runner Fluff is a twist on our best-selling wool sneaker. It&#39;s outrageously soft and cozy, flexible, supportive, and machine washable. The Wool Runner Fluff is comfortable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-CA": "<p>The Allbirds Wool Runner Fluff is a twist on our best-selling wool sneaker. It&#39;s outrageously soft and cozy, flexible, supportive, and machine washable. The Wool Runner Fluff is comfortable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-EU": "<p>The Allbirds Wool Runner Fluff is a twist on our best-selling wool sneaker. It&#39;s outrageously soft and cozy, flexible, supportive, and machine washable. The Wool Runner Fluff is comfortable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>"
      },
