      "id": 6764840321156,
      "handle": "womens-wool-runners-lux-beige",
      "masterId": "WOMENS_WOOL_RUNNERS",
      "description": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world's most comfortable shoe, it's flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
      "localizedDescription": {
        "de-DE": "<p>Der Allbirds Wool Runner ist unser Original-Sneaker aus Wolle, mit dem alles angefangen hat. Er wird oft als der bequemste Schuh der Welt bezeichnet, denn er bietet genügend Halt, ist vielseitig, weich und praktischerweise auch noch waschmaschinenfest. Der Wool Runner ist luftig und leicht und kann auch ohne Socken getragen werden. Am besten eignet er sich als Freizeitschuh bei kühlerem Wetter.</p>",
        "en-US": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "fr-FR": "<p>La Wool Runner d&#39;Allbirds est la basket en laine par laquelle tout a commencé. Appelée la chaussure la plus confortable du monde, elle est flexible, souple, étonnamment douce et lavable en machine. La Wool Runner est aérée, légère et peut être portée sans chaussettes. Elle est idéale pour la marche, les temps plus frais et les tenues décontractées au quotidien.</p>",
        "it-IT": "<p>Le Allbirds Wool Runner sono le sneakers originali in lana da cui tutto ha avuto inizio. Famose per essere le scarpe più comode del mondo, sono flessibili, di supporto, incredibilmente morbide e lavabili in lavatrice. Le Wool Runner sono traspiranti, leggere e possono essere indossate senza calze. Sono ideali per camminare, nelle giornate di freddo e per un look casual giornaliero.</p>",
        "ja-JP": "<p>Wool Runnerは、オールバーズのはじまりの1足。「世界で最も快適な靴」と呼ばれ、うっとりする肌触り、柔軟性、サポート力、そして洗濯機で洗えることが特徴です。軽くて通気性にも優れており、靴下なしでもとっても快適。涼しい日のウォーキングやお出かけに最適です。</p>",
        "ko-KR": "<p>Wool Runner는 올버즈의 시작이었습니다. 세상에서 가장 편한 신발이라는 애칭과 함께 신축성과 지지력이 뛰어나며 놀랍도록 부드러운 기계 세탁 사용이 가능한 신발입니다. 또한 통기성이 뛰어나고 가벼우며 양말 없이도 신을 수 있습니다. 워킹화로 최적이며 쌀쌀한 날씨나 데일리 캐주얼웨어에 완벽합니다.</p>",
        "nl-NL": "<p>De Allbirds Wool Runner is de originele wollen sneaker waar het allemaal mee begon. De Wool Runner wordt ook wel &#39;s werelds meest comfortabele schoen genoemd. Hij is flexibel, ondersteunend, verbazingwekkend zacht en machinewasbaar. De Wool Runner is ademend, licht en kan zonder sokken worden gedragen. Ideaal om te wandelen, bij frisser weer, en past bij elke casual look.</p>",
        "zh-CN": "<p>经典出众的时尚休闲鞋，拥有天然的柔软性和舒适度，让您行动自如。</p>",
        "en-GB": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-AU": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-NZ": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-CA": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-EU": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>"
      },
