        "nl-NL": "<p>De Allbirds Wool Runner is de originele wollen sneaker waar het allemaal mee begon. De Wool Runner wordt ook wel &#39;s werelds meest comfortabele schoen genoemd. Hij is flexibel, ondersteunend, verbazingwekkend zacht en machinewasbaar. De Wool Runner is ademend, licht en kan zonder sokken worden gedragen. Ideaal om te wandelen, bij frisser weer, en past bij elke casual look.</p>",
        "zh-CN": "<p>经典出众的时尚休闲鞋，拥有天然的柔软性和舒适度，让您行动自如。</p>",
        "en-GB": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-AU": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-NZ": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-CA": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>",
        "en-EU": "<p>The Allbirds Wool Runner is the orginal wool sneaker that started it all. Called the world&#39;s most comfortable shoe, it&#39;s flexible, supportive, astonishingly soft, and machine washable. The Wool Runner is breathable, lightweight, and can be worn sockless. Best used for walking, cooler weather, and everyday casual wear.</p>"
