        "ko-KR": "<p>Wool Runner-up Mizzle은 ZQ 메리노 울과 바이오 기반의 발수 쉴드로 만든 우천에 완벽한 하이탑 스니커즈입니다. 어떤 날씨에도 보송하고 따뜻한 발을 유지하세요.</p>",
        "nl-NL": "<p>De Wool Runner-up Mizzle is ideaal bij regenachtig weer, gemaakt van ZQ Merinowol met een bio-based waterafstotende beschermlaag zodat je voeten droog en warm blijven tijdens alle weersomstandigheden.</p>",
        "zh-CN": "<p>此款全新高帮晴雨鞋以柔软舒适的美利奴羊毛为面料，利用天然橡胶鞋底加深底部纹路，结合Puddle Guard™防泼水涂层面料，带你发现雨天的美好。</p>",
